import{o as a,c as e,d as r}from"./app.e9024871.js";const h='{"title":"印象云笔记转md","description":"","frontmatter":{},"headers":[{"level":2,"title":"印象云笔记转md","slug":"印象云笔记转md"},{"level":2,"title":"网易云音乐","slug":"网易云音乐"},{"level":2,"title":"坚果云同步","slug":"坚果云同步"}],"relativePath":"src/private/其他笔记.md","lastUpdated":1621152186485}',d={},i=r('<h2 id="印象云笔记转md"><a class="header-anchor" href="#印象云笔记转md" aria-hidden="true">#</a> 印象云笔记转md</h2><p>安装：<code>npm install enex-dump -g</code></p><p>转换：<code>enex-dump --src ./my-notes.enex</code></p><h2 id="网易云音乐"><a class="header-anchor" href="#网易云音乐" aria-hidden="true">#</a> 网易云音乐</h2><p>1、下载项目：<a href="https://github.com/nondanee/UnblockNeteaseMusic" target="_blank" rel="noopener noreferrer">https://github.com/nondanee/UnblockNeteaseMusic</a> 2、打开cmd，输入：ping <a href="http://music.163.com" target="_blank" rel="noopener noreferrer">music.163.com</a>，并记住ip地址； 3、解压项目，在项目根目录打开cmd，输入<code>node app.js -p 2333 -f 59.111.181.60</code>(这里的ip地址改成你本地ping到的地址) 4、打开网易云音乐设置，找到工具--&gt;自定义代理--&gt;服务器输入：127.0.0.1，端口输入2333(或者node命令指定的端口)</p><h2 id="坚果云同步"><a class="header-anchor" href="#坚果云同步" aria-hidden="true">#</a> 坚果云同步</h2><ol><li><p>路径：</p><div class="language-js"><pre><code><span class="token constant">C</span><span class="token operator">:</span>\\Users\\hny\\AppData\\Roaming\\Nutstore\n</code></pre></div></li><li><p>创建<code>customExtRules.conf</code>文件，放进上面的路径里面，<strong>可以为其他的路径</strong>，重点带db开头就行，里面如果包含以下三个文件之一就行：</p><ul><li>event.db</li><li>ga.data</li><li>nustore.db</li></ul><div class="language-bash"><pre><code></code></pre></div></li></ol><h1 id="坚果云自定义忽略同步规则"><a class="header-anchor" href="#坚果云自定义忽略同步规则" aria-hidden="true">#</a> 坚果云自定义忽略同步规则</h1><h1 id=""><a class="header-anchor" href="#" aria-hidden="true">#</a></h1><h1 id="警告"><a class="header-anchor" href="#警告" aria-hidden="true">#</a> 警告:</h1><h1 id="该文件用来自定义坚果云的忽略同步规则-文件编码必须为-utf-8"><a class="header-anchor" href="#该文件用来自定义坚果云的忽略同步规则-文件编码必须为-utf-8" aria-hidden="true">#</a> 该文件用来自定义坚果云的忽略同步规则, 文件编码必须为 UTF-8.</h1><h1 id="由于用户修改了自定义忽略规则导致坚果云无法正常工作的问题由用户自己负责"><a class="header-anchor" href="#由于用户修改了自定义忽略规则导致坚果云无法正常工作的问题由用户自己负责" aria-hidden="true">#</a> 由于用户修改了自定义忽略规则导致坚果云无法正常工作的问题由用户自己负责.</h1><h1 id="-2"><a class="header-anchor" href="#-2" aria-hidden="true">#</a></h1><h1 id="说明"><a class="header-anchor" href="#说明" aria-hidden="true">#</a> 说明:</h1><h1 id="每行一条规则-以-开头的行将被忽略"><a class="header-anchor" href="#每行一条规则-以-开头的行将被忽略" aria-hidden="true">#</a> 每行一条规则. 以 # 开头的行将被忽略.</h1><h1 id="每条规则必须以英文半角句号开头-否则会忽略"><a class="header-anchor" href="#每条规则必须以英文半角句号开头-否则会忽略" aria-hidden="true">#</a> 每条规则必须以英文半角句号开头, 否则会忽略</h1><h1 id="无效的规则会被忽略-并在坚果云日志文件中提示"><a class="header-anchor" href="#无效的规则会被忽略-并在坚果云日志文件中提示" aria-hidden="true">#</a> 无效的规则会被忽略, 并在坚果云日志文件中提示.</h1><h1 id="-3"><a class="header-anchor" href="#-3" aria-hidden="true">#</a></h1><h1 id="注意事项"><a class="header-anchor" href="#注意事项" aria-hidden="true">#</a> 注意事项:</h1><h1 id="忽略规则仅影响文件-不影响文件夹"><a class="header-anchor" href="#忽略规则仅影响文件-不影响文件夹" aria-hidden="true">#</a> 忽略规则仅影响文件, 不影响文件夹</h1><h1 id="忽略规则会且仅会在-上传-时生效"><a class="header-anchor" href="#忽略规则会且仅会在-上传-时生效" aria-hidden="true">#</a> 忽略规则会且仅会在 <em>上传</em> 时生效</h1><h1 id="每次修改需要重启客户端才能生效"><a class="header-anchor" href="#每次修改需要重启客户端才能生效" aria-hidden="true">#</a> 每次修改需要重启客户端才能生效.</h1><h1 id="该规则文件不会自动同步到其他设备"><a class="header-anchor" href="#该规则文件不会自动同步到其他设备" aria-hidden="true">#</a> 该规则文件不会自动同步到其他设备.</h1><h1 id="-4"><a class="header-anchor" href="#-4" aria-hidden="true">#</a></h1><h1 id="例子"><a class="header-anchor" href="#例子" aria-hidden="true">#</a> 例子:</h1><h1 id="忽略所有扩展名为-bak-的文件-规则为-bak"><a class="header-anchor" href="#忽略所有扩展名为-bak-的文件-规则为-bak" aria-hidden="true">#</a> 忽略所有扩展名为 *.bak 的文件, 规则为 .bak</h1><h1 id="disabled-blacklist-whitelist-三选一"><a class="header-anchor" href="#disabled-blacklist-whitelist-三选一" aria-hidden="true">#</a> disabled/blacklist/whitelist 三选一</h1><h1 id="disabled-禁用该功能"><a class="header-anchor" href="#disabled-禁用该功能" aria-hidden="true">#</a> disabled 禁用该功能</h1><h1 id="blacklist-黑名单模式-列出的文件类型都不会被上传"><a class="header-anchor" href="#blacklist-黑名单模式-列出的文件类型都不会被上传" aria-hidden="true">#</a> blacklist 黑名单模式, 列出的文件类型都不会被上传</h1><h1 id="whitelist-白名单模式-只上传列出的文件类型"><a class="header-anchor" href="#whitelist-白名单模式-只上传列出的文件类型" aria-hidden="true">#</a> whitelist 白名单模式, 只上传列出的文件类型</h1><p>mode=blacklist</p><h1 id="规则开始"><a class="header-anchor" href="#规则开始" aria-hidden="true">#</a> 规则开始</h1><p>.bak E:\\note\\node_modules # 禁止同步具体路径文件夹 E:\\note.vuepress\\dist</p><div class="language-"><pre><code>\n修改完成需要重启坚果云\n\n</code></pre></div>',34);d.render=function(r,h,d,s,n,t){return a(),e("div",null,[i])};export default d;export{h as __pageData};
